import React, { Component } from "react";

class YearEdition extends Component {
	render() {
		return(
			<div class="year-edition">
				<p>{this.props.year}</p>
				<img src={require('./res/rallye'+this.props.year+'.png')} alt="Screenshot du site du rallye" />
	        </div>
		);
	}
}

export default YearEdition;
